import React from "react";
import Trip from "./Trip";
import world from "./world.png";

const Passport = () => {
  const temptripsbeforefetch = [
    { country: "peru", flag: "../flags/peru.png" },
    { country: "cuba", flag: "../flags/cuba.jpeg" },
  ];
  return (
    <div
      style={{
        background: `url(${world})`,
        height: "100vh",
        width: "100%",
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    >
      <h1>Here is your passport!</h1>
      {temptripsbeforefetch.map((trip) => {
        <Trip country={trip.country} flag={trip.flag} />;
      })}
    </div>
  );
};

export default Passport;
